def predict(triples: list[Triple]) -> str:
    """
    Generates a natural language sentence from a list of triples.
    """
    sentence = ""
    subject = ""
    clauses = []
    for triple in triples:
        if not subject:
            subject = triple.subject

        if triple.predicate == "cityServed":
            clauses.append(f"{subject} serves the city of {triple.object}")
        elif triple.predicate == "elevationAboveTheSeaLevel":
            clauses.append(f"{subject} is at an elevation of {triple.object} meters above sea level")
        elif triple.predicate == "location":
            clauses.append(f"{subject} is located in {triple.object}")
        elif triple.predicate == "country":
            clauses.append(f"{subject} is in {triple.object}")
        elif triple.predicate == "runwayLength":
            clauses.append(f"{subject} has a runway length of {triple.object} meters")
        elif triple.predicate == "runwayName":
            clauses.append(f"the runway is named {triple.object}")
        else:
            clauses.append(f"{subject} has a {triple.predicate} of {triple.object}")

    sentence = ", ".join(clauses) + "."
    return sentence.strip()

